    GLKMatrix4 _projectionMatrix;
    GLKMatrix4 _baseModelViewMatrix;
    
    // Skybox:
    GLKMatrix4 _skyboxModelViewProjectionMatrix;
    GLKMatrix3 _skyboxNormalMatrix;
