#pragma mark -  Load Shaders
- (GLuint)setupTexture:(NSString *)fileName
{
    // This method from http://stackoverflow.com/q/7930148/2775
    // TODO: see if this is flipping the texture across the Y axis.
    CGImageRef spriteImage = [UIImage imageNamed:fileName].CGImage;
    if (!spriteImage)
    {
        NSLog(@"Failed to load image %@", fileName);
        exit(1);
    }
    size_t width = CGImageGetWidth(spriteImage);
    size_t height = CGImageGetHeight(spriteImage);
    GLubyte * spriteData = (GLubyte *) calloc(width*height*4, sizeof(GLubyte));
    CGContextRef spriteContext = CGBitmapContextCreate(spriteData, width, height, 8,     width*4,CGImageGetColorSpace(spriteImage), kCGImageAlphaPremultipliedLast);
    CGContextDrawImage(spriteContext, CGRectMake(0, 0, width, height), spriteImage);
    CGContextRelease(spriteContext);
    GLuint texName;
    glGenTextures(1, &texName);
    glBindTexture(GL_TEXTURE_2D, texName);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_LINEAR_MIPMAP_LINEAR);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_LINEAR);
    glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_S, GL_CLAMP_TO_EDGE);
    glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_T, GL_CLAMP_TO_EDGE);
    glTexImage2D(GL_TEXTURE_2D, 0, GL_RGBA, width, height, 0, GL_RGBA, GL_UNSIGNED_BYTE, spriteData);
    GLenum err = glGetError();
    if (err != GL_NO_ERROR)
        NSLog(@"Error uploading texture. glError: 0x%04X", err);
    free(spriteData);
    
    glGenerateMipmap(GL_TEXTURE_2D);
    
    return texName;
}

#pragma mark -  OpenGL ES 2 shader compilation

- (BOOL)loadSkyboxShaders
{
    GLuint vertShader, fragShader;
    NSString *vertShaderPathname, *fragShaderPathname;
    
    // Create shader program.
    _skyboxProgram = glCreateProgram();
    
    // Create and compile vertex shader.
    vertShaderPathname = [[NSBundle mainBundle] pathForResource:@"SkyboxShader" ofType:@"vsh"];
    if (![self compileShader:&vertShader type:GL_VERTEX_SHADER file:vertShaderPathname]) {
        NSLog(@"Failed to compile vertex shader");
        return NO;
    }
    
    // Create and compile fragment shader.
    fragShaderPathname = [[NSBundle mainBundle] pathForResource:@"SkyboxShader" ofType:@"fsh"];
    if (![self compileShader:&fragShader type:GL_FRAGMENT_SHADER file:fragShaderPathname]) {
        NSLog(@"Failed to compile fragment shader");
        return NO;
    }
    
    // Attach vertex shader to program.
    glAttachShader(_skyboxProgram, vertShader);
    
    // Attach fragment shader to program.
    glAttachShader(_skyboxProgram, fragShader);
    
    // Bind attribute locations.
    // This needs to be done prior to linking.
    glBindAttribLocation(_skyboxProgram, GLKVertexAttribPosition, "position");
    glBindAttribLocation(_skyboxProgram, GLKVertexAttribColor, "color");
    // TODO: specify uniform color for "color" instead of using vertex data
    glBindAttribLocation(_skyboxProgram, GLKVertexAttribTexCoord0, "textureCoordinate");
    
    // Link program.
    if (![self linkProgram:_skyboxProgram]) {
        NSLog(@"Failed to link program: %d", _skyboxProgram);
        
        if (vertShader) {
            glDeleteShader(vertShader);
            vertShader = 0;
        }
        if (fragShader) {
            glDeleteShader(fragShader);
            fragShader = 0;
        }
        if (_skyboxProgram) {
            glDeleteProgram(_skyboxProgram);
            _skyboxProgram = 0;
        }
        
        return NO;
    }
    
    // Get uniform locations.
    cubeUniforms[UNIFORM_MODELVIEWPROJECTION_MATRIX] = glGetUniformLocation(_skyboxProgram, "modelViewProjectionMatrix");
    cubeUniforms[UNIFORM_NORMAL_MATRIX] = glGetUniformLocation(_skyboxProgram, "normalMatrix");
    
    // Release vertex and fragment shaders.
    if (vertShader) {
        glDetachShader(_skyboxProgram, vertShader);
        glDeleteShader(vertShader);
    }
    if (fragShader) {
        glDetachShader(_skyboxProgram, fragShader);
        glDeleteShader(fragShader);
    }
    
    return YES;
}

- (BOOL)loadPlaneShaders
{
    GLuint vertShader, fragShader;
    NSString *vertShaderPathname, *fragShaderPathname;
    
    // Create shader program.
    _planeProgram = glCreateProgram();
    
    // Create and compile vertex shader.
    vertShaderPathname = [[NSBundle mainBundle] pathForResource:@"PlaneShader" ofType:@"vsh"];
    if (![self compileShader:&vertShader type:GL_VERTEX_SHADER file:vertShaderPathname]) {
        NSLog(@"Failed to compile vertex shader");
        return NO;
    }
    
    // Create and compile fragment shader.
    fragShaderPathname = [[NSBundle mainBundle] pathForResource:@"PlaneShader" ofType:@"fsh"];
    if (![self compileShader:&fragShader type:GL_FRAGMENT_SHADER file:fragShaderPathname]) {
        NSLog(@"Failed to compile fragment shader");
        return NO;
    }
    
    // Attach vertex shader to program.
    glAttachShader(_planeProgram, vertShader);
    
    // Attach fragment shader to program.
    glAttachShader(_planeProgram, fragShader);
    
    // Bind attribute locations.
    // This needs to be done prior to linking.
    glBindAttribLocation(_planeProgram, GLKVertexAttribPosition, "position");
    glBindAttribLocation(_planeProgram, GLKVertexAttribNormal, "normal");
    glBindAttribLocation(_planeProgram, GLKVertexAttribTexCoord0, "inputTextureCoordinate");
    
    // Link program.
    if (![self linkProgram:_planeProgram]) {
        NSLog(@"Failed to link program: %d", _planeProgram);
        
        if (vertShader) {
            glDeleteShader(vertShader);
            vertShader = 0;
        }
        if (fragShader) {
            glDeleteShader(fragShader);
            fragShader = 0;
        }
        if (_planeProgram) {
            glDeleteProgram(_planeProgram);
            _planeProgram = 0;
        }
        
        return NO;
    }
    
    // Get uniform locations.
    planeUniforms[UNIFORM_MODELVIEWPROJECTION_MATRIX] = glGetUniformLocation(_planeProgram, "modelViewProjectionMatrix");
    planeUniforms[UNIFORM_NORMAL_MATRIX] = glGetUniformLocation(_planeProgram, "normalMatrix");
    
    // Release vertex and fragment shaders.
    if (vertShader) {
        glDetachShader(_planeProgram, vertShader);
        glDeleteShader(vertShader);
    }
    if (fragShader) {
        glDetachShader(_planeProgram, fragShader);
        glDeleteShader(fragShader);
    }
    
    return YES;
}

- (BOOL)compileShader:(GLuint *)shader type:(GLenum)type file:(NSString *)file
{
    GLint status;
    const GLchar *source;
    
    source = (GLchar *)[[NSString stringWithContentsOfFile:file encoding:NSUTF8StringEncoding error:nil] UTF8String];
    if (!source) {
        NSLog(@"Failed to load vertex shader");
        return NO;
    }
    
    *shader = glCreateShader(type);
    glShaderSource(*shader, 1, &source, NULL);
    glCompileShader(*shader);
    
#if defined(DEBUG)
    GLint logLength;
    glGetShaderiv(*shader, GL_INFO_LOG_LENGTH, &logLength);
    if (logLength > 0) {
        GLchar *log = (GLchar *)malloc(logLength);
        glGetShaderInfoLog(*shader, logLength, &logLength, log);
        NSLog(@"Shader compile log:\n%s", log);
        free(log);
    }
#endif
    
    glGetShaderiv(*shader, GL_COMPILE_STATUS, &status);
    if (status == 0) {
        glDeleteShader(*shader);
        return NO;
    }
    
    return YES;
}

- (BOOL)linkProgram:(GLuint)prog
{
    GLint status;
    glLinkProgram(prog);
    
#if defined(DEBUG)
    GLint logLength;
    glGetProgramiv(prog, GL_INFO_LOG_LENGTH, &logLength);
    if (logLength > 0) {
        GLchar *log = (GLchar *)malloc(logLength);
        glGetProgramInfoLog(prog, logLength, &logLength, log);
        NSLog(@"Program link log:\n%s", log);
        free(log);
    }
#endif
    
    glGetProgramiv(prog, GL_LINK_STATUS, &status);
    if (status == 0) {
        return NO;
    }
    
    return YES;
}

- (BOOL)validateProgram:(GLuint)prog
{
    GLint logLength, status;
    
    glValidateProgram(prog);
    glGetProgramiv(prog, GL_INFO_LOG_LENGTH, &logLength);
    if (logLength > 0) {
        GLchar *log = (GLchar *)malloc(logLength);
        glGetProgramInfoLog(prog, logLength, &logLength, log);
        NSLog(@"Program validate log:\n%s", log);
        free(log);
    }
    
    glGetProgramiv(prog, GL_VALIDATE_STATUS, &status);
    if (status == 0) {
        return NO;
    }
    
    return YES;
}

#pragma mark - User Input
- (IBAction)connectControllerButtonTouchUpInside:(id)sender {
    if (ble.activePeripheral) {
        if (ble.activePeripheral.isConnected)
        {
            // Disconnect:
            [[ble CM] cancelPeripheralConnection:[ble activePeripheral]];
            [connectControllerButton setTitle:@"Connect" forState:UIControlStateNormal];
            return;
        }
    }
    [connectControllerButton setEnabled:false];
    [connectControllerButton setTitle:@"Connecting..." forState:UIControlStateDisabled];
    [ble findBLEPeripherals:2]; // Why is this 2?
    [NSTimer scheduledTimerWithTimeInterval:2.0f target:self selector:@selector(connectionTimer:) userInfo:nil repeats:NO];
}

- (void)connectionTimer: (NSTimer *)timer
{
    connectControllerButton.enabled = true;
    [connectControllerButton setTitle:@"Disconnect" forState:UIControlStateNormal];
    
    if (ble.peripherals.count > 0)
    {
        [ble connectPeripheral:[ble.peripherals objectAtIndex:0]];
    }
    else
    {
        [connectControllerButton setTitle:@"Connect" forState:UIControlStateNormal];
    }
}

#pragma mark - BLE Delagate methods
- (void)bleDidDisconnect
{
    NSLog(@"-->Disconnected");
    
    [connectControllerButton setTitle:@"Connect" forState:UIControlStateNormal];
    
//    self.RssiLabel.text = @"---";
    
    // reset state of all controls
    struct NWControllerInputData inputData = {};
    _currentInput = inputData;
}

-(void)bleDidUpdateRSSI:(NSNumber *)rssi
{
//    self.RssiLabel.text = rssi.stringValue;
}

-(void)bleDidConnect
{
    NSLog(@"-->Connected");
    
    [connectControllerButton setTitle:@"Disconnect" forState:UIControlStateNormal];
}

-(void)bleDidReceiveData:(unsigned char *)data length:(int)length
{
//    NSLog(@"Length: %d", length);
    
    if (length >= 3) {
        struct NWControllerInputData inputData = {};
        inputData.IsConnected = true;

        inputData.AxisX = 2.0f * data[0] / 255.0f - 1.0f;
        inputData.AxisY = 2.0f * data[1] / 255.0f - 1.0f;
        unsigned char buttons = data[2];        
        inputData.ButtonDownA = (buttons & 0x01) != 0;
        inputData.ButtonDownB = (buttons & 0x02) != 0;
        inputData.ButtonDownX = (buttons & 0x04) != 0;
        inputData.ButtonDownY = (buttons & 0x08) != 0;
        inputData.ButtonDownStick = (buttons & 0x10) != 0;
        inputData.ButtonDownStart = (buttons & 0x20) != 0;
        
        _currentInput = inputData;
    }
}

